function swap(json){
  var ret = {};
  for(var key in json){
    ret[json[key]] = key;
  }
  return ret;
}

function round(value, decimals) {
  return Number(Math.round(value+'e'+decimals)+'e-'+decimals);
}


function sortList(ul){
    var new_ul = ul.cloneNode(false);

    // Add all lis to an array
    var lis = [];
    for(var i = ul.childNodes.length; i--;){
        if(ul.childNodes[i].nodeName === 'LI')
            lis.push(ul.childNodes[i]);
    }

    // Sort the lis in descending order
    lis.sort(function(a, b){
       return parseInt(b.childNodes[0].data.split(":")[1].substring(1,), 10) - 
              parseInt(a.childNodes[0].data.split(":")[1].substring(1,), 10);
    });

    // Add them into the ul in order
    for(var i = 0; i < lis.length; i++)
        new_ul.appendChild(lis[i]);
    ul.parentNode.replaceChild(new_ul, ul);
}

function upperCaseFirstLetter(string) {
    return string.charAt(0).toUpperCase() + string.slice(1);
}

                                         upperCaseFirstLetter(efp["name_last"][key]) + ": " + efp["EFP"][key]))

  subUL = document.createElement("ul")

  li.addEventListener("click", function() {
    console.log("value: " + this.value)
    console.log("id: " + this.id)
    toggleHideChildren(this.id)
  })

function myFunction(input, list) {
    // Declare variables
    var filter, ul, li, a, i, txtValue;
    filter = input.value.toUpperCase();
    if (input.id == "playerInput") {highlight(filter)}
    //ul = document.getElementById(listId);
    ul = list
    li = ul.getElementsByTagName('li');
  
    // Loop through all list items, and hide those who don't match the search query
    for (i = 0; i < li.length; i++) {
      if (li[i].className == "subLI") {
        continue;
      }
      a = li[i].getElementsByTagName("a")[0];
      a = li[i].textContent
      txtValue = a
      //txtValue = a.textContent || a.innerText;
      if (txtValue.toUpperCase().indexOf(filter) > -1) {
        li[i].style.display = "";
      } else {
        li[i].style.display = "none";
      }
    }
  }


var color = "steelblue";

var values = Object.keys(swap(efp["EFP"]))
values = values.map(x => parseFloat(x));

// A formatter for counts.
var formatCount = d3.format(",.0f");

var margin = {top: 20, right: 30, bottom: 30, left: 30},
    width = 960 - margin.left - margin.right,
    height = 500 - margin.top - margin.bottom;

var max = d3.max(values);
var min = d3.min(values);
var x = d3.scale.linear()
      .domain([min, max])
      .range([0, width]);

// Generate a histogram using twenty uniformly-spaced bins.
var data = d3.layout.histogram()
    .bins(x.ticks(25))
    (values);

console.log(values)
console.log(data)
var yMax = d3.max(data, function(d){return d.length});
var yMin = d3.min(data, function(d){return d.length});
var colorScale = d3.scale.linear()
            .domain([yMin, yMax])
            .range([d3.rgb(color).brighter(), d3.rgb(color).darker()]);

var y = d3.scale.linear()
    .domain([0, yMax])
    .range([height, 0]);

var xAxis = d3.svg.axis()
    .scale(x)
    .orient("bottom");

var svg = d3.select("div").append("svg")
    .attr("width", width + margin.left + margin.right)
    .attr("height", height + margin.top + margin.bottom)
  .append("g")
    .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

svg.append("text")
  .attr("class", "x label")
  .attr("text-anchor", "end")
  .attr("font-size", "30px")
  .attr("fill", "#dddddd")
  .attr("x", width / 2 + 50)
  .attr("y", height + 30)
  .text("EFP")

var bar = svg.selectAll(".bar")
    .data(data)
  .enter().append("g")
    .attr("class", "bar")
    .attr("transform", function(d) { return "translate(" + x(d.x) + "," + y(d.y) + ")"; });

bar.append("rect")
    .attr("x", 1)
    .attr("width", (x(data[0].dx) - x(0)) - 1)
    .attr("height", function(d) { return height - y(d.y); })
    .attr("fill", function(d) { return colorScale(d.y) });

bar.append("text")
    .attr("dy", ".75em")
    .attr("y", -12)
    .attr("x", (x(data[0].dx) - x(0)) / 2)
    .attr("text-anchor", "middle")
    .attr("fill", "#dddddd")
    .text(function(d) { return formatCount(d.y); });

svg.append("g")
    .attr("class", "x axis")
    .attr("transform", "translate(0," + height + ")")
    .style({
      //fill: "none",
      stroke: "#dddddd",
      //"stroke-width": "10"
    })
    .call(xAxis);


function highlight(filter){
  var vals = [] // valid EFP for the selected names
  for (var key in efp["EFP"]) {
    var name = efp["name_first"][key] + " " + efp["name_last"][key]
    if (name.toUpperCase().indexOf(filter) > -1) {
      vals.push(efp["EFP"][key])
    }
  }

  

  svg.selectAll("rect").attr("fill", function(d) {
    if (vals.length > 17) {
    return colorScale(d.y)
  }
    for (var i = 0; i < vals.length; i++) {
      let efp = vals[i]
      if (efp >= d.x && efp <= d.x + d.dx) {
        return "#FFDC00"
      }
    }
    return colorScale(d.y)
  })

}
